import styled from 'styled-components';
import TextBox from '../common/TextBox';

function TopArea() {
    const textContents = {
        title: 'A Simple',
        desc: 'A clean and simple',
    };

    const { title, desc } = textContents;

    return (
        <TopSection>
            <div>
                <TextBox title={'A Simple'} desc={'A clean and simple'} />
            </div>
        </TopSection>
    );
}

const TopSection = styled.div`
    display: flex;
`;

export default TopArea;
